import React from 'react';
import auth from '../Components/auth';



export const Start = (props) => 
	(
		<div> 
		<h1> Start page </h1>
		<a onClick={() =>{
			auth.logout(() => {
				props.history.push('/');
			})
		}}> logout</a>
		</div>

	)
